const Sidebar = ({ onDragStart }) => {
    return (
      <aside>
        <div className="dndnode" onDragStart={(e) => onDragStart(e, 'rectangle')} draggable>
          Rectangle
        </div>
        <div className="dndnode" onDragStart={(e) => onDragStart(e, 'circle')} draggable>
          Circle
        </div>
        <div className="dndnode" onDragStart={(e) => onDragStart(e, 'triangle')} draggable>
          Triangle
        </div>
      </aside>
    );
  };
